import React from 'react'
import { Image } from 'react-bootstrap'
import header from "./header-image.jpg"

function Header() {
  return (
    <div>
        <Image src={header} alt="" style={{width:"100%", borderBottom:"10px double white",borderTop:"2px solid white"}} />
    </div>
  )
}

export default Header
